import Vue from 'vue'
import VueRouter from 'vue-router'
const Home = ()=> import('@views/home/Home')

// 1.安装插件
Vue.use(VueRouter)

const routes = [
  {
    path:'',
    components:Home,
  }
]

// 2.创建router
const router = new VueRouter({
  routes
})

export default router
